   // Adjust based on your ReturnDetailsDTO\n}\n\n@Component({\n  selector: 'app-allorderstatus',\n  standalone:false,\n  templateUrl: './allorderstatus.component.html',\n  styleUrls: ['./allorderstatus.component.sass']\n})\nexport class AllorderstatusComponent implements OnInit {\n  orders: Order[] = [];\n  orderStatuses: string[] = ['Pending', 'Shipped', 'Delivered', 'Cancelled', 'Return Requested', 'Return Approved', 'Return Rejected'];\n  errorMessage: string = '';\n  loading: boolean = false;\n\n  constructor(private http: HttpClient) { }\n\n  ngOnInit(): void {\n    this.loadAllOrders();\n  }\n\n  loadAllOrders(): void {\n    this.loading = true;\n    this.http.get('http://localhost:8082/dbs/order/admin/all') // Replace with your API endpoint\n      .pipe(\n        catchError((error) => {\n          this.errorMessage = 'Error loading orders.';\n          console.error('Error loading orders:', error);\n          this.loading = false;\n          return of([]);\n        })\n      )\n      .subscribe(data => {\n        this.orders = data;\n        this.loading = false;\n      });\n  }\n\n  updateOrderStatus(orderId: number, newStatus: string): void {\n \n     \n    const updateUrl = `http://localhost:8082/dbs/order/${orderId}/${newStatus}/${1}`;  \n\n    this.http.put(updateUrl, {})  \n      .pipe(\n        catchError((error) => {\n          this.errorMessage = `Error updating order ${orderId}.`;\n          console.error('Error updating order:', error);\n          return of(null);\n        })\n      )\n      .subscribe(updatedOrder => {\n        if (updatedOrder) {\n          const index = this.orders.findIndex(order => order.orderId === orderId);\n          if (index !== -1) {\n            this.orders[index].status = newStatus;\n          }\n        }\n      });\n  }\n}\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/Order-1.html":{"url":"interfaces/